from pathlib import Path
from typing import List
from modules.token import TokenEntry

FAVICON_DATA_URL = "data:image/x-icon;base64,"

def generate_index(novnc_dir: Path, tokens: List[TokenEntry], port: int, lan_ip: str):
    target = novnc_dir / "index.html"
    if target.exists():
        try:
            target.unlink()
        except Exception:
            pass
    favicon = FAVICON_DATA_URL.strip() or None
    pwd = ""
    try:
        p = novnc_dir / "pwd.conf"
        if p.exists():
            pwd = p.read_text(encoding="utf-8", errors="ignore").strip()
    except Exception:
        pwd = ""
    top = f"""<!doctype html>
<html lang="zh-CN">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>noVNC </title>
    {"<link rel=\"icon\" href=\"" + favicon + "\">" if favicon else ""}
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css" rel="stylesheet">
  </head>
  <body class="bg-light">
    <div class="container py-5">
      <h3 class="text-center mb-4">{lan_ip}</h3>
      <div id='gate' class='row justify-content-center'><div class='col-12 col-md-6'><div class='card p-3'><label class='form-label'></label><input id='pwdInput' type='password' class='form-control' placeholder='Password'><div class='mt-3 d-grid'><button id='pwdBtn' class='btn btn-success'></button></div><div id='pwdMsg' class='text-danger mt-2' style='display:none;'></div></div></div></div>
      <div id="content" class="" style="display:none;">
"""
    items = []
    urls_js = "[" + ", ".join(f"'{f'http://{lan_ip}:{port}/vnc.html?path=websockify?token={t.id}'}'" for t in tokens[:2]) + "]"
    for i, t in enumerate(tokens[:2]):
        url = f"http://{lan_ip}:{port}/vnc.html?path=websockify?token={t.id}"
        item = f"""        <div class="text-center">
          <div class="mb-2"><span class="badge bg-secondary">{t.ip}</span></div>
          <a href="{url}" class="btn btn-primary btn-lg"> {i+1}</a>
        </div>
"""
        items.append(item)
    bottom = """      </div>
    </div>
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/js/bootstrap.bundle.min.js"></script>
    <script>
    const PWD = """ + (f"'{pwd}'" if pwd else "''") + """;
    const URLS = """ + urls_js + """;
    if (PWD) {
      const btn = document.getElementById('pwdBtn');
      const input = document.getElementById('pwdInput');
      const msg = document.getElementById('pwdMsg');
      const gate = document.getElementById('gate');
      const content = document.getElementById('content');
      content.style.display = 'none';
      btn.addEventListener('click', () => {
        if (input.value === PWD) {
          gate.style.display = 'none';
          content.style.display = 'flex';
          content.className = 'd-flex flex-column align-items-center gap-4';
          content.scrollIntoView({behavior:'smooth'});
          msg.style.display = 'none';
          btn.disabled = true;
          input.disabled = true;
        } else {
          msg.style.display = 'block';
        }
      });
      input.addEventListener('keyup', (e) => {
        if (e.key === 'Enter') btn.click();
      });
    }
    </script>
  </body>
</html>
"""
    content = top + "".join(items) + bottom
    target.write_text(content, encoding="utf-8")
